Otak-otak Otak-otak ya iku panganan saka Indonésia, Malaysia, lan Singapura kang digawé saka iwak (padatan iwak tengiri utawa bandeng) kang dibumboni lan diungkus godhong gedhang.[1][2] Diarani otak-otak jalaran wujude alus lan lunyu kayadene utek manungsa.[1] Otak-otak ana kang digawé saka iwak tengiri, nanging uga ana kang digawé saka iwak bandheng. Otak-otak tengiri digawé saka iwak tengiri kang wis dialusake, santen, pati, unclang, putihan endhog, uyah, bawang, mrica, lan penyedap rasa. Kabe
